g2:c.PROCEDURE.g2:a.TEXT:
_csruisup-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces; 
  intstuffName: symbol = the symbol int-internals-workspaces;
  Err: class error;

begin

  {--- No startup required for module restart }
  if not(InitialStartup) then return;

  {--- For devstuff development environment } 
  if the item named by devstuffName exists then
    insert _csruisup-internals at the end of the item-list named by devstuffName;
  if the item named by intstuffName exists then
    insert _csruisup-internals at the end of the item-list named by intstuffName;

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end

g2:c.METHOD.g2:a.TEXT:
oos-invalidate-view (Manager: class object-manager-event-manager {the manager to be updated}, Nodes: sequence {A sequence of structures defining the information for the deleted nodes}, Client: class ui-client-item {the client for this call})
{This method is called to invalidate the views.<p>} 
ListenerList: class item-list;
Listener: class object-manager-event-listener;
Event: class object-manager-event;
ListenerError: class error;
begin
    ListenerList = call get-event-listener-list (Manager);
    Event = call g2-event-create-event(object-manager-event, Client);
    conclude that the object-manager-event-data of Event = structure (object-manager-event-type: the symbol INVALIDATE, remote-queue-event-list: Nodes);
    for Listener = each object-manager-event-listener in ListenerList do
        begin 
            call object-manager-invalidate-tree (Listener, Event);
        end on error(ListenerError)
            { Obviously it is not behaving, so remove it from listener list}
            call remove-g2-event-listener (Manager, Listener);
        end;
    end; 
    delete Event; 
end

remove-object-manager-event-listener (Manager: class object-manager-event-manager {The manager which Listener is to be removed from}, Listener: class object-manager-event-listener {The listener in the remote system which will is to be removed})
{This API should be called to remove a Listener from a ViewManager.}
begin
    call remove-g2-event-listener (Manager, Listener);
end

add-object-manager-event-listener (Manager: class object-manager-event-manager {The manager which is to notify Listener}, Listener: class object-manager-event-listener {The listener in the remote system which will be notified of changes})
{This API should be called from an object manager client when that client wishes to listen to change events that effect an object manager view.  The proper manager for this call can be obtained by calling get-object-manager-event-manager.  Listener is added to as an event listener to the manager.}
Event: class remote-queue-event;
begin
    call add-g2-event-listener (Manager, Listener);
end

oos-update-view-per-deletion(Manager: class object-manager-event-manager {the manager to be updated}, Nodes: sequence {A sequence of structures defining the information for the deleted nodes}, Client: class ui-client-item {the client for this call})
{This method is called to update the views in response to one or more nodes being removed from the object manager.  This method should never be called either by the user-written KB code or by the remote browser itself.<p>} 
ListenerList: class item-list;
Listener: class object-manager-event-listener;
Event: class object-manager-event;
ListenerError: class error;
begin
    ListenerList = call get-event-listener-list (Manager);
    Event = call g2-event-create-event(object-manager-event, Client);
    conclude that the object-manager-event-data of Event = structure (object-manager-event-type: the symbol DELETION, remote-queue-event-list: Nodes);
    for Listener = each object-manager-event-listener in ListenerList do
        begin 
            call object-manager-nodes-added (Listener, Event);
        end on error(ListenerError)
            { Obviously it is not behaving, so remove it from listener list}
            call remove-g2-event-listener (Manager, Listener);
        end;
    end; 
    delete Event; 
end

oos-update-view-per-addition(Manager: class object-manager-event-manager {the manager to be updated}, Nodes: sequence {A sequence of structures defining the information for the newly-created nodes}, Client: class ui-client-item {the client for this call})
{This method is called to update the views in response to one or more nodes being added to the object manager.  This method should never be called either by the user-written KB code or by the remote browser itself.<p>} 
ListenerList: class item-list;
Listener: class object-manager-event-listener;
Event: class object-manager-event;
ListenerError: class error;
begin
    ListenerList = call get-event-listener-list (Manager);
    Event = call g2-event-create-event(object-manager-event, Client);
    conclude that the object-manager-event-data of Event = structure (object-manager-event-type: the symbol ADDITION, remote-queue-event-list: Nodes);
    for Listener = each object-manager-event-listener in ListenerList do
        begin 
            call object-manager-nodes-added (Listener, Event);
        end on error(ListenerError)
            { Obviously it is not behaving, so remove it from listener list}
            call remove-g2-event-listener (Manager, Listener);
        end;
    end; 
    delete Event; 
end

g2:c.PROCEDURE.g2:a.TEXT:
get-object-manager-event-manager () = (class object-manager-event-manager)
{This API should be called from a remote client when needs a manager for the object manager}
Manager: class object-manager-event-manager = oos-default-object-manager-manager;
begin
    return Manager;
end

create-item-for-object-manager (NodeConfiguration: structure, Win: class ui-client-item) = (item-or-value)
Item, TmpItem: item-or-value;
ModuleName, Category, Specifier: symbol;
NotOverrideItemCheck: truth-value = true;
Manager: class object-manager-event-manager = oos-default-object-manager-manager;
begin
    Category = the CATEGORY of NodeConfiguration;
    Specifier = the SPECIFIER of NodeConfiguration;
    if the MODULE-NAME of NodeConfiguration exists then ModuleName = the MODULE-NAME of NodeConfiguration else ModuleName = the symbol ALL;
    if (Category = the symbol definition) then Item = call _opcsui-create-class-definition (ModuleName, Specifier, Win) 
    else if (Category = the symbol OPAC-PROCEDURE) then begin
        Item = call _opcsui-create-opac-procedure (the symbol OPAC-NEW-PROCEDURE, ModuleName, Win); 
        if Item exists then begin
          make Item transient;
         TmpItem = call get-corresponding-item (NodeConfiguration, ModuleName);
          if the subworkspace of TmpItem exists then transfer Item to the subworkspace of TmpItem;
          make Item permanent;
        end;
    end
    else begin
        case (Specifier) of
            dxi-type-to-class-object: Item = call _opcsui-create-translation-object (ModuleName, Win);
            opcsrui-palette: Item = call _opcsui-create-palette (ModuleName, Win);
            completion-routine: begin
                Item = call _opcsui-create-completion-procedure (ModuleName, Win);
                NotOverrideItemCheck = false;
            end;
            reasoning-routine: begin
                Item = call _opcsui-create-reasoning-procedure (ModuleName, Win);
                NotOverrideItemCheck = false;
            end;
            opac-new-procedure: Item = call _opcsui-create-opac-procedure (the symbol OPAC-NEW-PROCEDURE, ModuleName, Win); {Note that the class opac-new-procedure is a variable child-node-type on the classic client}
            smh-gep-object: Item = call _opcsui-create-escalation-procedure (ModuleName, Win);
            smh-message-server: Item = call _opcsui-create-message-server (ModuleName, Win);
            sc-browser-template: Item = call _opcsui-create-browser (ModuleName, Win);
            sc-status-display: Item = call _opcsui-create-status-bar (ModuleName, Win);
            glf-logging-manager: Item = call _opcsui-create-logging-manager (ModuleName, Win);
            otherwise: return the symbol UNABLE-TO-CREATE;
        end;
    end;
    if NotOverrideItemCheck and Item is an item then call oos-update-view-per-addition(Manager, sequence(), Win);
    return Item;
end

get-item-in-workspace-heiarchy (Parent : class item, ItemName: symbol)  = (class item) 
Item : class item;
CurrentItem: text;
ItemFound: truth-value = FALSE;
Wksp: class kb-workspace;
begin
    if the subworkspace Wksp of Parent exists then begin
        for Item = each item upon Wksp do
          if Item is not an opxb-gr-go-to-developer-help-button and the subworkspace of Item exists then begin
                CurrentItem = call g2-name-for-item (Item);
                if CurrentItem = "[ItemName]" then begin
                    ItemFound = TRUE;
                    exit if TRUE;
                end;
          end;
        end;
    end;
    if ItemFound then return Item
    else return Parent;
return Item;
end

get-items-having-subworkspaces-of-workspace(Wksp : class kb-workspace)  = (sequence) 
Item : class item;
Seq : sequence=sequence();
begin
    for Item = each item upon Wksp do
      if Item is not an opxb-gr-go-to-developer-help-button and the subworkspace of Item exists then begin
        Seq = insert-at-end(Seq, Item);
      end;
    end;
return Seq;
end

append-to-node-configuration-sequence (InitialSequence: sequence, Specifiers: sequence, Category: symbol, IsLeaf: truth-value, AreItems: truth-value) = (sequence)
Specifier: item-or-value;
Struct: structure;
DisplayString: text;
SpecifierKey: symbol;
ItemNameText: text;
ItemName: symbol;
AttributeNameValue: item-or-value;
AttributeName: symbol = the symbol FOLDER-ID; {make this an argument}
NamedItem: truth-value = FALSE;
begin
    for Specifier = each item-or-value in Specifiers do
        if (AreItems) then begin {need to make this a procdure}
            if _csruisup-debug then inform the operator that "specifier is a [the class of specifier]";
            if Specifier is an instance of the class named by (the symbol DXI-TYPE-TO-CLASS-OBJECT) then begin
                DisplayString = "[the dxi-type-string of Specifier]->[the text of the dxi-type-class of Specifier]";
                SpecifierKey = the symbol FOO;
            end
            else if Specifier is an instance of the class named by (the symbol uil-goto-workspace-button) then begin
                DisplayString = "[the label of Specifier]";
                if the name ItemName of Specifier exists then begin
                    NamedItem = TRUE;
                end
                else begin
                    ItemNameText = call g2-name-for-item (Specifier);
                    ItemName = symbol (ItemNameText);
                    NamedItem = FALSE;
                end;
                SpecifierKey = ItemName;
            end
            else if the name ItemName of Specifier exists then begin
                Specifierkey = ItemName;
                DisplayString = lower-case-text ("[ItemName]");
            end
            else if the value AttributeNameValue that is an attribute of Specifier named by attributeName exists then begin
                Specifierkey = the symbol FOO;
                DisplayString = "[AttributeNameValue]";
            end
            else begin
                SpecifierKey = the symbol FOO;
                DisplayString = lower-case-text ("a(n) [the class of Specifier]");
            end;
        end
        else begin
            DisplayString = lower-case-text ("[Specifier]");
            SpecifierKey = Specifier;
        end;
        Struct = structure (CATEGORY: Category, SPECIFIER: SpecifierKey, DISPLAY-STRING: DisplayString, IS-LEAF: IsLeaf, IS-VIEWABLE: true);
        if _csruisup-debug then inform the operator that "struct = [struct]";
        if AreItems then Struct = change-attribute (Struct, CORRESPONDING-ITEM, Specifier);
        InitialSequence = insert-at-beginning (InitialSequence, Struct);
    end;
    return InitialSequence;
end

get-subworkspaced-item-names(ItemName : symbol) = (sequence)
SubWSName: symbol;
I: class item;
SubWS : class kb-workspace;
Names: sequence = sequence();
N : symbol;
WS : class kb-workspace;
begin
  I = the item named by ItemName;
  if I is a kb-workspace then WS = I
  else WS = the subworkspace of I;
  if WS exists and WS is a kb-workspace then begin  
      for I = each item upon WS do
          if (the subworkspace SubWS of I exists) and (the name N of I exists) then 
             Names = insert-at-end(Names, N);
      end;
  end;
 inform the operator that "The Subworkspaced Item Names:-->[Names] for [ItemName]";
  return Names; 
end

get-names-of-items-of-class-on-workspace(Wksp : class kb-workspace,
                                                        Class : symbol)  = (sequence) 
ItemName : symbol;
Item : class item;
SW : class kb-workspace;
Seq : sequence=sequence();
SeqTemp:sequence;
begin
    for Item = each item upon Wksp do
      if Item is an instance of the class named by (Class) then begin
        if the name of Item exists then 
            Seq = insert-at-end(Seq, the name of Item);
    end;
end;
return Seq;
end

get-items-of-class-on-or-below-workspace(Wksp : class kb-workspace,
                                                       Class : symbol)  = (sequence) 
SubItem: class item;
Item : class item;
SW : class kb-workspace;
Seq : sequence=sequence();
SeqTemp:sequence;
begin
    for Item = each item upon Wksp do
      if Item is an instance of the class named by (Class) then begin
        Seq = insert-at-end(Seq, Item);
        if the subworkspace SW of Item exists then begin 
           SeqTemp = call get-items-of-class-on-or-below-workspace (SW, Class);
{Commented out because it was flattening out the heiarchy.
           for SubItem = each item in SeqTemp do
                Seq = insert-at-end(Seq, SubItem);
           end;
}
        end;
    end;
end;
return Seq;
end

get-children-for-node(NodeConfiguration: structure)  = (sequence)
CdgLoaded: truth-value = false;
CdgCorrMgrGatherer: symbol = the symbol cdg-correlation-manager-gatherer-1;
CdgCorrelationManagerGathererClass : symbol = the symbol cdg-correlation-manager-gatherer;
GetCdgObjectsProc: symbol = the symbol get-cdg-objects;
CdgGatherer: class item;
CdgDiagramFolderGathererClass: symbol = the symbol cdg-diagram-folder-gatherer;
Category: symbol;
Specifier: item-or-value ;
Children: sequence;
CurrentChildren : sequence;
Child: symbol;
Bin: class kb-workspace;
Bins: sequence;
TmpItm: class item;
ModuleName : symbol = the symbol foo;
ErrorName: symbol = the symbol OK;
ErrorText: text = "No Error";
begin
    if _csruisup-debug then inform the operator that "nodeconfiguration = [nodeconfiguration]";
    CdgLoaded = _opcs-check-for-cdg ();
   Category = the CATEGORY of NodeConfiguration;
   Specifier = the SPECIFIER of NodeConfiguration;
   if the MODULE-NAME of NodeConfiguration exists then 
       ModuleName = the MODULE-NAME of NodeConfiguration;
   if Category = the symbol ROOT then 
        Children = call get-object-manager-configuration(Specifier, ModuleName)
   else if CdgLoaded and Category = the symbol RUNTIME-HEADER then begin
         Children = sequence(structure(CATEGORY: the symbol CDG-MANAGERS-HEADER,
                                                 SPECIFIER: the value of CdgCorrMgrGatherer,
                                                 DISPLAY-STRING: "Correlation Managers",
                                                 IS-LEAF: false,
                                                 IS-VIEWABLE: false)); end
   else if Category = the symbol DEVELOPMENT-TIME-HEADER then 
        Children = call get-module-configurations()
   else if CdgLoaded and Category = the symbol CDG-GENERIC-DIAGRAMS-HEADER then begin
        CdgGatherer = the item named by specifier;
        if CdgGatherer is an instance of the class named by (CdgDiagramFolderGathererClass) then begin
            Children = call the procedure named by GetCdgObjectsProc (CdgGatherer, ModuleName);
            Children = call create-node-configuration-sequence(Children, the symbol LEAF, true, true); 
        end;
   end
   else if CdgLoaded and Category = the symbol CDG-MANAGERS-HEADER then begin
        CdgGatherer = the item named by specifier;
        if CdgGatherer is an instance of the class named by (CdgCorrelationManagerGathererClass) then begin 
             Children = call the procedure named by GetCdgObjectsProc (CdgGatherer, ModuleName);
             Children = call create-node-configuration-sequence(Children, the symbol LEAF, true, true); end 
      end
   else if Category = the symbol DEFINITION-HEADER then 
        Children = call get-module-top-level-definition-nodes(ModuleName, Specifier)
   else if Category = the symbol WORKSPACE-HEADER then begin
        if _csruisup-debug then inform the operator that "module name = [modulename], specifier = [specifier]";
        Children = call get-top-level-named-workspace-names(ModuleName);
        Children = call create-node-configuration-sequence(Children, the symbol WORKSPACE, false, false); end
{
        Children = call create-node-configuration-sequence(Children, the symbol BIN-HEADER, false, false); end
}
   else if Category = the symbol BIN-HEADER then begin
      Bins = call get-node-type-workspaces-for-module(ModuleName, Specifier);
      Children = sequence();
       for Bin = each kb-workspace in Bins do 
        if (Specifier = the symbol DXI-TYPE-TO-CLASS-OBJECT) then begin 
           CurrentChildren = call get-items-of-class-on-or-below-workspace(Bin, Specifier); 
           Children = call append-to-node-configuration-sequence(Children, CurrentChildren, the symbol LEAF, true, true); 
         end 
        else begin 
            CurrentChildren = call get-names-of-items-of-class-on-or-below-workspace(Bin, Specifier); 
            Children = call append-to-node-configuration-sequence(Children, CurrentChildren, the symbol LEAF, true, false); end
          end
      end
   else if Category = the symbol OPAC-PROCEDURE-BIN-HEADER then begin
     Bins = call get-node-type-workspaces-for-module(ModuleName, Specifier);
     Children = sequence();
      for Bin = each kb-workspace in Bins do 
        CurrentChildren = call get-names-of-items-of-class-on-workspace(Bin, Specifier);
        Children = call append-to-node-configuration-sequence (Children, CurrentChildren, the symbol OPAC-PROCEDURE, false, false); end
     end
   else if Category = the symbol PROCEDURE-BIN-HEADER then begin
     Bins = call get-node-type-workspaces-for-module(ModuleName, Specifier); 
     Children = sequence();
      for Bin = each kb-workspace in Bins do 
        CurrentChildren = call get-procedures-on-or-below-workspace(Bin);
        Children = call append-to-node-configuration-sequence(Children, CurrentChildren, the symbol LEAF, true, true); end 
    end
   else if Category = the symbol OPAC-PROCEDURE then begin
        TmpItm = call get-corresponding-item (NodeConfiguration, ModuleName);
        Bin = the subworkspace of TmpItm;
        Children = call get-names-of-items-of-class-on-workspace(Bin, the symbol OPAC-NEW-PROCEDURE);
        Children = call create-node-configuration-sequence(Children, the symbol OPAC-PROCEDURE, false, false); end
   else if Category = the symbol WORKSPACE then begin
      TmpItm = call get-corresponding-item (NodeConfiguration, ModuleName);
{
      ModuleName = gfr-get-module-of-item (TmpItm);
      Bins = call get-node-type-workspaces-for-module(ModuleName, Specifier);
      Children = sequence();
}
        if _csruisup-debug then inform the operator that "ModuleName = [ModuleName], Specifier = [Specifier], tmpitm = [the class of tmpitm]";
           Children = sequence ();
           CurrentChildren = call get-items-having-subworkspaces-of-workspace (TmpItm);
        if _csruisup-debug then inform the operator that "current children = [currentchildren]";
           Children = call append-to-node-configuration-sequence(Children, CurrentChildren, the symbol WORKSPACE, false, true);
    end
{ original
        Children = call get-subworkspaced-item-names(Specifier);
        Children = call create-node-configuration-sequence(Children, the symbol WORKSPACE, false, false); end
}
   else if Category = the symbol DEFINITION then begin
        Children = call get-inferior-class-names(Specifier);
        Children = call create-node-configuration-sequence(Children, the symbol DEFINITION, false, false); end;
        if _csruisup-debug then inform the operator that "category = [category], Specifier = [specifier]";
return Children;
end on error (ErrorName, ErrorText)
    if _csruisup-debug then inform the operator that "Error: [ErrorName],
[ErrorText]";
end

create-module-description(ModuleName: symbol) = (structure)
Description  : structure;
DisplayString : text;
CdgLoaded: truth-value = false; 
OpacLoaded : truth-value = false;
ObjectManagerConfigurationName: symbol;
begin
 CdgLoaded = _opcs-check-for-cdg (); 
 OpacLoaded = _opcs-check-for-opac ();
 if (CdgLoaded and OpacLoaded) then
    ObjectManagerConfigurationName = the symbol opac-and-cdg-object-manager-configuration
 else if (CdgLoaded) then
    ObjectManagerConfigurationName = the symbol cdg-object-manager-configuration
 else if (OpacLoaded) then
    ObjectManagerConfigurationName = the symbol opac-object-manager-configuration
 else 
    ObjectManagerConfigurationName = the symbol default-object-manager-configuration; 
 DisplayString = capitalize-words("[ModuleName]");
 
 Description =  structure(CATEGORY: the symbol ROOT, 
                                     SPECIFIER: ObjectManagerConfigurationName,
                                     MODULE-NAME: ModuleName, 
                                     DISPLAY-STRING: DisplayString, 
                                     IS-LEAF: false);
return Description;
end

get-module-configurations()= (sequence)
ModInfo : class module-information; 
TopModule, TLM: symbol; 
Modules: sequence = sequence();
Description : structure;
begin
    TopModule = call _devui-get-top-level-module ();
    Description = call create-module-description(TopModule);
    Modules = insert-at-end (Modules,  Description);
    for ModInfo = each module-information do
      if (not (_devui-does-module-belong-to-opex (the top-level-module TLM of ModInfo)) and 
        (TLM /= TopModule)) then begin
         Description = call create-module-description(TLM);
         Modules = insert-at-end(Modules, Description);
        end;
    end;
Description = call create-module-description(the symbol all);
Modules = insert-at-end(Modules, Description);
return Modules
end

get-corresponding-item (NodeConfiguration: structure, ModuleName: symbol) = (class item)
Category: symbol;
Specifier: symbol;
Itm: class item;
IorV: item-or-value;
Parent: class item;
begin
    Category = the CATEGORY of NodeConfiguration;
    Specifier = the SPECIFIER of NodeConfiguration;
    if Category = the symbol WORKSPACE then begin
        {    Itm = the item named by Specifier; original code   }
        If there exists an item Itm named by Specifier then begin
        end
        else if the item-or-value IorV named by Specifier then begin
            if IorV is an item then Itm = IorV;
{
        else if the corresponding-item Parent of NodeConfiguration exists then begin
            Itm = call get-item-in-workspace-heiarchy (Parent, Specifier);
}
        end;
        if Itm is not a kb-workspace then Itm = the subworkspace of Itm;
    end
    else if Category = the symbol DEFINITION then Itm = the definition named by Specifier
    else if Category = the symbol LEAF or Category = the symbol OPAC-PROCEDURE then Itm = the item named by Specifier; {should look for more specific class}
    return Itm;
end

create-node-configuration-sequence(Specifiers: sequence, 
                                                Category: symbol, 
                                                IsLeaf: truth-value,
                                                AreItems: truth-value) = (sequence)
Seq: sequence  = sequence();
begin
    Seq = call append-to-node-configuration-sequence (Seq, Specifiers, Category, IsLeaf, AreItems);
    return Seq;
end

get-object-manager-configuration(object-manager-configuration-object-name : symbol,
                                           ModuleName : symbol) = (sequence)
OMC: class object-manager-configuration;
Seq : sequence = sequence();
Struct: structure;
NewStruct: structure;
begin
  if there exists an object-manager-configuration OMC named by object-manager-configuration-object-name 
    then begin
    for Struct = each structure in the top-level-nodes of OMC do
        NewStruct = change-attribute(Struct, MODULE-NAME, ModuleName);
        Seq = insert-at-end(Seq, NewStruct);
     end;
    end;
return Seq;
end

point-to-item(OBJ: class item)
Arrow: class _opcsrui-arrow;
I: integer; 
begin
create an _opcsrui-arrow Arrow; 
wait for .5 second;
call g2-set-item-color (Arrow, the symbol arrow, opcsrui-go-to-arrow-color-1); 
transfer Arrow to the workspace of OBJ at (the item-x-position of Obj + 20, the item-y-position of OBJ + 20);
for I = 1 to 5 do
    call g2-set-item-color (Arrow, the symbol arrow, opcsrui-go-to-arrow-color-1);
    wait for 1 second;
    call g2-set-item-color (Arrow, the symbol arrow, opcsrui-go-to-arrow-color-2);
    wait for 1 second;
end;
delete Arrow; 
end

get-domain-map-workspace () = (class kb-workspace)
I: class item;
Wksp: class kb-workspace;
Btn: item-or-value;
TopModule: symbol;
begin
    if opcsui-domain-map-workspace = the symbol UNSPECIFIED then begin
        TopModule = call _devui-get-top-level-module ();
        if TopModule = the symbol OPTEG then TopModule = the symbol OPTEGRITY;
        Btn = call uil-get-grobj-from-id ("[TopModule]-domain-map");
        if Btn exists and Btn is an item and the subworkspace of Btn exists then Wksp = the subworkspace of Btn;
    end
    else begin
        if there exists an item I named by opcsui-domain-map-workspace then begin
            if I is a kb-workspace then Wksp = I
            else if the subworkspace of I exists then Wksp = the subworkspace of I;
        end;
    end;
    return Wksp;
end

get-procedures-on-or-below-workspace(Wksp : class kb-workspace)  = (sequence) 
Procedure : class item;
Item : class item;
SW : class kb-workspace;
Seq : sequence=sequence();
SeqTemp:sequence;
begin
    for Item = each item upon Wksp do
      if Item is a procedure and Item is not a method-declaration then 
        Seq = insert-at-end(Seq, Item);
      if the subworkspace SW of Item exists then begin 
         SeqTemp = call get-procedures-on-or-below-workspace (SW);
         for Procedure = each Item in SeqTemp do
              Seq = insert-at-end(Seq, Procedure);
         end;      
      end;
  end;
return Seq;
end

get-palette-names() = (sequence)
PaletteDescriptions: sequence = sequence(); 
WorkspacePalette : symbol = the symbol _devui-buttons-palette;
FilterPalette : symbol = the symbol sc-browser-palette;
Palette : class opcsrui-palette;
Label : text;
