get-names-of-procedures-on-or-below-workspace(Wksp : class kb-workspace)  = (sequence) 
ProcedureName : symbol;
Item : class item;
SW : class kb-workspace;
Seq : sequence=sequence();
SeqTemp:sequence;
begin
    for Item = each item upon Wksp do
      if Item is a procedure and Item is not a method-declaration then 
        Seq = insert-at-end(Seq, the name of Item);
      if the subworkspace SW of Item exists then begin 
         SeqTemp = call get-names-of-procedures-on-or-below-workspace (SW);
         for ProcedureName = each symbol in SeqTemp do
              Seq = insert-at-end(Seq, ProcedureName);
         end;      
      end;
  end;
return Seq;
end

get-names-of-items-of-class-on-or-below-workspace(Wksp : class kb-workspace,
                                                                    Class : symbol)  = (sequence) 
ItemName : symbol;
Item : class item;
SW : class kb-workspace;
Seq : sequence=sequence();
SeqTemp:sequence;
begin
    for Item = each item upon Wksp do
      if Item is an instance of the class named by (Class) then begin
        if the name of Item exists then 
            Seq = insert-at-end(Seq, the name of Item);
        if the subworkspace SW of Item exists then begin 
           SeqTemp = call get-names-of-items-of-class-on-or-below-workspace (SW, Class);
           for ItemName = each symbol in SeqTemp do
                Seq = insert-at-end(Seq, ItemName);
           end;
        end;
    end;
end;
return Seq;
end

get-node-type-workspaces-for-module(ModuleName: symbol,
                                                NodeType: symbol) = (sequence)
Bin : item-or-value;
M: class opcsrui-module-storage-information;
Seq: sequence = sequence();
begin
   if (ModuleName = the symbol ALL) then begin 
        for M = each opcsrui-module-storage-information do begin 
            ModuleName = the opcsrui-module-name of M;
            if ModuleName exists then begin 
              Bin = call _devui-get-bin(ModuleName, NodeType);
              if Bin exists and Bin is an item then 
                Seq = insert-at-end(Seq, the subworkspace of Bin);
           end
         end
    end; 
   end else begin 
      Bin = call _devui-get-bin(ModuleName, NodeType);
      if Bin exists and Bin is an item then 
        Seq = insert-at-end(Seq, the subworkspace of Bin);
  end;
 return Seq;
end

get-subworkspaced-item-names-old(ItemName : symbol) = (sequence)
SubWSName: symbol;
I: class item;
SubWS : class kb-workspace;
Names: sequence = sequence();
N : symbol;
WS : class kb-workspace;
ItemText: text;
ItemSym: symbol;
begin
{Convert the ItemName to a reference an actual Item}
  I = the item named by ItemName;
  if I is a kb-workspace then WS = I
  else WS = the subworkspace of I;
  if WS exists and WS is a kb-workspace then begin  
      for I = each item upon WS do
            if (I is a uil-goto-workspace-button) and (the subworkspace of I exists) then begin
                ItemText = the label of I;
                ItemSym = call devu-convert-text-to-symbol (ItemText);
                Names = insert-at-end (Names, ItemSym);
            end
            else if I is a opxb-gr-go-to-developer-help-button then begin
                {Do nothing for the developer help buttons}
            end
            else if the subworkspace SubWS of I exists then begin
                ItemText = call devu-ext-name-or-name-as-string-proc (SubWs);
                ItemSym = call devu-convert-text-to-symbol (ItemText);
                Names = insert-at-end (Names, ItemSym);
            end;
      end;
  end;
 inform the operator that "The Subworkspaced Item Names:-->[Names] for [ItemName]";
  return Names; 
end

get-top-level-named-workspace-names(ModuleName: symbol) = (sequence)
WSName: symbol;
WS : class kb-workspace;
Names: sequence = sequence();
begin
   for WS = each kb-workspace do       
        if ((the item superior to WS does not exist) and 
           (the name WSName of WS exists) and 
           ((ModuleName = the symbol ALL) or
            (gfr-get-module-of-item(WS) = ModuleName))) then 
                Names = insert-at-end(Names, WSName);
   end;
   {inform the operator that "Top Level Workspaces for [ModuleName]:-->[Names]";}
   return Names; 
end

get-inferior-class-names(ClassName: symbol) = (sequence)                                         
InferiorClasses: sequence = sequence();
InferiorClass: symbol;
begin
  for InferiorClass = each symbol that is an inferior-class of ClassName do 
     InferiorClasses = insert-at-end(InferiorClasses, InferiorClass);
  end;
  { inform the operator that "InferiorClasses of [ClassName]:-->[InferiorClasses]";}
  return InferiorClasses;
end

get-module-top-level-definition-nodes(ModuleName: symbol,
                                                DefinitionClassSpecifier : symbol) = (sequence)
ModulePrefix: text;
Seq: sequence = sequence();
M: class opcsrui-module-storage-information;
DefName : symbol;
Node: structure;
begin

 if (ModuleName = the symbol ALL) then begin
        for M = each opcsrui-module-storage-information do        
        ModulePrefix = the opcsrui-module-prefix of M;
        DefName = symbol("[ModulePrefix]-[DefinitionClassSpecifier]");
        if (there exists a class-definition named by DefName) then begin 
           Node = structure(CATEGORY: the symbol DEFINITION, SPECIFIER: DefName, DISPLAY-STRING: lower-case-text("[DefName]"), IS-LEAF: false, IS-VIEWABLE: true);
           Seq = insert-at-end(Seq, Node);
        end;
    end
  end else begin
     ModulePrefix = call get-module-prefix (ModuleName);
    DefName = symbol("[ModulePrefix]-[DefinitionClassSpecifier]");
    Node = structure(CATEGORY: the symbol DEFINITION, SPECIFIER: DefName, DISPLAY-STRING: lower-case-text("[DefName]"), IS-LEAF: false, IS-VIEWABLE: true);
    Seq = insert-at-end(Seq, Node); 
  end;
return Seq;
end
